            if starring and broadcasted_by and first_aired:
                sentence = f"Bananaman, {starring}, was broadcast by {broadcasted_by} and first aired on {first_aired}."
                if city:
                    sentence = f"{city}. " + sentence
                return sentence
    return sentence

